import React from "react";
import { useNavigate } from "react-router-dom";

const LoginForm = () => {
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("✅ 로그인 시도됨");
    navigate("/home");
  };

  return (
    <form onSubmit={handleSubmit} style={{ margin: "100px auto", width: "300px" }}>
      <input
        type="text"
        placeholder="아이디"
        style={{ width: "100%", padding: "10px", marginBottom: "10px" }}
      />
      <input
        type="password"
        placeholder="비밀번호"
        style={{ width: "100%", padding: "10px", marginBottom: "10px" }}
      />
      <button
        type="submit"
        style={{ width: "100%", padding: "12px", backgroundColor: "#333", color: "#fff" }}
      >
        Sign In
      </button>
    </form>
  );
};

export default LoginForm;
